import React, { Component } from "react";
import MobileSignup from "../../Common/Component/SignUp";
import "./index.scss";

export default class index extends Component {
  render() {
    return (
      <div className="mobile-signup">
        <MobileSignup isMobileSignupPage={true} />
      </div>
    )
  }
}
